// src/components/Boutton.jsx
// Position:  \src\Components\Boutton.jsx
import React from 'react';
import { Button } from '@mui/material';

function Boutton({ texte }) {
  return (
    <Button variant="contained" color="primary">
      {texte}
    </Button>
  );
}

export default Boutton;

